DROP TABLE IF EXISTS `escola`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `escola` (
  `idescola` int(11) NOT NULL AUTO_INCREMENT,
  `regional` int(11) DEFAULT NULL,
  `cidade` int(11) DEFAULT NULL,
  `inep` bigint(20) DEFAULT NULL,
  `escola` varchar(100) DEFAULT NULL,
  `endereco` text,
  `bairro` varchar(45) DEFAULT NULL,
  `telefone` varchar(45) DEFAULT NULL,
  `telefone2` varchar(45) DEFAULT NULL,
  `laboratorio` int(11) DEFAULT NULL,
  `modalidade` varchar(45) DEFAULT NULL,
  `modalidade2` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`idescola`),
  KEY `fk_escola_regional_idx` (`regional`),
  KEY `fk_escola_cidades_idx` (`cidade`),
  CONSTRAINT `fk_escola_cidades` FOREIGN KEY (`cidade`) REFERENCES `cidades` (`idcidades`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_escola_regional` FOREIGN KEY (`regional`) REFERENCES `regional` (`idregional`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=782 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

